import { Typography, Box, styled } from "@mui/material";
const Image = styled(Box)`
  background: url(/project_picture/blog_heading_back.png) center/55% repeat-x #000;
  height: 50vh;
  width: 100%;
`;

const Banner = () =>
{
  return (
    <Image>
      <Typography>Hello from banner</Typography>
    </Image>
  );
}

export default Banner;
